impl Solution {
    pub fn max_operations(s: String) -> i32 {
        let mut result = 0;
        let mut pra = 0;
        let mut onehainkinhi = false;
        let mut muttti = Vec::new();

        for char in s.chars() {
            if char == '1' {
                muttti.push(1);
                onehainkinhi = true;
            } else if char == '0' && onehainkinhi {
                muttti.push(0);
                onehainkinhi = false;
            }
        }

        for mutt in muttti {
            if mutt == 1 {
                pra += 1;
            } else {
                result += pra;
            }
        }

        result
    }
}
